import React from "react";
// import { Link } from "react-router-dom";

import HomeLink from "./HomeLink";
import AboutLink from "./AboutLink";
import ProductLink from "./ProductLink";

export default function Nav() {

    return (
        <nav>
            <ul>
                <li>
                    <HomeLink />
                </li>
                <li>
                    <AboutLink />
                </li>
                <li>
                    <ProductLink />
                </li>
            </ul>
        </nav >
    )
}
